import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import useAuth from '/../hooks/useAuth';
import '../styles/RegistrosPage.css';

const RegistrosPage = () => {
  const [registros, setRegistros] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const { auth } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchRegistros = async () => {
      try {
        const response = await axios.get('/api/registros/', {
          headers: {
            'Authorization': `Token ${auth.token}`
          }
        });
        setRegistros(response.data);
      } catch (err) {
        setError(err.response?.data?.message || 'Error al cargar registros');
      } finally {
        setLoading(false);
      }
    };

    if (auth.token) {
      fetchRegistros();
    }
  }, [auth.token]);

  const handleEditar = (id) => {
    navigate(`/registros/${id}/editar`);
  };

  const formatFecha = (fechaStr) => {
    const fecha = new Date(fechaStr);
    return fecha.toLocaleDateString('es-CO', {
      year: 'numeric',
      month: 'long',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  if (loading) return <div className="loading">Cargando registros...</div>;
  if (error) return <div className="error-message">{error}</div>;

  return (
    <div className="registros-container">
      <div className="header-section">
        <h1>Registros de Consumo Energético</h1>
        <button 
          className="btn-nuevo"
          onClick={() => navigate('/registros/nuevo')}
        >
          + Nuevo Registro
        </button>
      </div>

      <div className="registros-table-container">
        <table className="registros-table">
          <thead>
            <tr>
              <th>Fecha</th>
              <th>Ambiente</th>
              <th>Categoría</th>
              <th>Subcategoría</th>
              <th>Consumo (kWh/mes)</th>
              <th>Acciones</th>
            </tr>
          </thead>
          <tbody>
            {registros.map((registro) => (
              <tr key={registro.id}>
                <td>{formatFecha(registro.fecha_registro)}</td>
                <td>
                  {registro.ambiente_nombre || 'Sin ambiente'}
                  <div className="sede-info">
                    {registro.sede_nombre && `${registro.sede_nombre} • ${registro.centro_nombre}`}
                  </div>
                </td>
                <td>{registro.categoria_base}</td>
                <td>
                  {registro.subcategoria_1}
                  {registro.subcategoria_2 && ` • ${registro.subcategoria_2}`}
                  {registro.subcategoria_3 && ` • ${registro.subcategoria_3}`}
                </td>
                <td className="consumo-cell">
                  <span className="consumo-value">
                    {registro.consumo_kwh_mes.toFixed(2)}
                  </span>
                </td>
                <td>
                  <button 
                    className="btn-editar"
                    onClick={() => handleEditar(registro.id)}
                  >
                    Editar
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default RegistrosPage;
